import UserFinder from './components/UserFinder';
import UsersContext from './store/users-context';

const DUMMY_USERS = [
  { id: 'u1', name: 'Peter' },
  { id: 'u2', name: 'Moses' },
  { id: 'u3', name: 'Francis' },
  { id: 'u5', name: 'Delphister' },
  { id: 'u6', name: 'Agness' },
  { id: 'u6', name: 'Brian' },
];

const MORE_USERS = [
  { id: 'u1', name: 'Musonda' },
  { id: 'u2', name: 'Chitundu' },
  { id: 'u3', name: 'Chishimba' },
  { id: 'u5', name: 'Mulundu' },
  { id: 'u6', name: 'Mutoto' },
  { id: 'u6', name: 'Chewe' },
];

function App() {
  const usersContext = {
    users: DUMMY_USERS,
    moreUsers: MORE_USERS,
  }

  return (
    <UsersContext.Provider value={usersContext}>
      <UserFinder />
    </UsersContext.Provider>
  );
}

export default App;
